import { Done } from '@mui/icons-material';
import { IconButton } from '@mui/material';
import React, { useState } from 'react';

export default function Journal() {
    const[note, updateNote] = useState({});

    const date=new Date().toLocaleDateString();
    return(<div>
        <header className='w3-container' style={{fontFamily: 'Albert Sans'}}>{date}</header>
        <form className='w3-container'>
            <input placeholder='Title' value={note.title}></input>
            <textarea placeholder='Take a note...' value={note.content} />
            <IconButton aria-label='submit note'>
                <Done />
            </IconButton>
        </form>
    </div>)
};
